import React from 'react';
import { motion } from 'framer-motion';

const Home = () => {
  return (
    <section id="home" className="min-h-screen flex flex-col justify-center px-8 lg:px-24 relative">
      {/* Main Content */}
      <div className="max-w-7xl mx-auto w-full">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="relative"
        >
          {/* Hero Content */}
          <div className="flex flex-col lg:flex-row items-start justify-between">
            <div className="lg:w-1/2">
              <h1 className="text-4xl lg:text-6xl font-mono mb-6">
                Elias is a{' '}
                <span className="text-accent">web designer</span> and{' '}
                <span className="text-accent">front-end developer</span>
              </h1>

              <p className="text-text-secondary text-lg mb-8">
                He crafts responsive websites where technologies meet creativity
              </p>

              <div className="flex items-center gap-4">
                <button className="px-8 py-2 border border-accent text-accent hover:bg-accent hover:text-white transition-colors rounded">
                  Contact me!!
                </button>
                <div className="flex items-center gap-2 bg-card/50 px-4 py-1 rounded border border-border">
                  <span className="text-accent">Currently working on</span>
                  <span className="text-text-secondary">Portfolio</span>
                </div>
              </div>
            </div>

            {/* Hero Image */}
            <div className="lg:w-1/2 relative mt-12 lg:mt-0">
              <div className="relative">
                <img
                  src="/images/placeholder.svg"
                  alt="Elias"
                  className="w-full max-w-lg mx-auto"
                />
                {/* Decorative Elements */}
                <div className="absolute -right-4 top-4 grid grid-cols-4 gap-2">
                  {[...Array(16)].map((_, i) => (
                    <div key={i} className="w-2 h-2 bg-accent rounded-full"></div>
                  ))}
                </div>
                <div className="absolute -left-8 bottom-8 w-24 h-24">
                  <div className="relative w-full h-full">
                    <div className="absolute inset-0 border border-accent/20"></div>
                    <div className="absolute inset-0 border border-accent/20 rotate-45"></div>
                  </div>
                </div>
              </div>
            </div>
          </div>

          {/* Quote */}
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.3 }}
            className="mt-24 relative max-w-2xl"
          >
            <div className="relative pl-6 border-l-2 border-accent">
              <p className="text-xl font-mono">
                With great power comes great electricity bill
              </p>
              <p className="text-text-secondary mt-2">- Dr. Who</p>
            </div>
          </motion.div>
        </motion.div>
      </div>

      {/* Background Patterns */}
      <div className="absolute top-1/4 right-0 w-64 h-64 grid grid-cols-8 gap-2 opacity-20">
        {[...Array(64)].map((_, i) => (
          <div key={i} className="w-2 h-2 bg-accent rounded-full"></div>
        ))}
      </div>
      <div className="absolute bottom-1/4 left-1/4 w-48 h-48">
        <div className="relative w-full h-full">
          <div className="absolute inset-0 border border-accent/20"></div>
          <div className="absolute inset-0 border border-accent/20 rotate-45"></div>
        </div>
      </div>
    </section>
  );
};

export default Home;
